/**
 * Degree [dmm] to decimal
 *
 * @param {string} data - Degree in dmm.
 * @return {number} decimals
 */
const degToDec = data => {
  let decimal = 0.0
//   console.log("degToDec: " + data)
  const _data = data.match(/(\d{2,3})(\d{2}[.]\d+),([NSWE])/).slice(1)
  const deg = _data[0]
  const min = _data[1]
  const sign = _data[2]
  decimal = parseFloat(deg) + parseFloat(min) / 60
  if (sign === 'S' || sign === 'W') {
    decimal *= -1
  }
  return decimal
}

